import { Div } from '@tensorflow/tfjs-core';
import { divImpl } from './Div_impl';
export const divConfig = {
  kernelName: Div,
  backendName: 'webgl',
  kernelFunc: ({
    inputs,
    backend
  }) => {
    const a = inputs.a,
          b = inputs.b;
    const webglBackend = backend;
    return divImpl(a, b, webglBackend);
  }
};
